export const ADD_TWEET = 'ADD_TWEET';
export const LIKE_TWEET = 'LIKE_TWEET';
export const LIKE_TWEET_SUCCESS = 'LIKE_TWEET_SUCCESS';


export function addTweet(tweet) {
    return {
        type: ADD_TWEET,
        tweet
    }
}

export function likeTweet(tweet) {
    return {
        type: LIKE_TWEET,
        tweet
    }
}
